import { provideRouter } from '@angular/router';
import { deviceStatusComponent } from './deviceStatus/deviceStatus.component';
import { ExpressTest } from './ExpressTest/ExpressTest.component';
const routes = [{
  path: '',
  redirectTo: '/deviceStatus',
  pathMatch: 'full'
}, {
  path: 'deviceStatus',
  component: deviceStatusComponent
}, {
  path: 'expressTest',
  component: ExpressTest
}];
export const appConfig = {
  providers: [provideRouter(routes)]
